    <div className="rating">
      {arr.map((j) => {
        <Star value={value} req={j}>
          {" "}
        </Star>;
      })}
      <Star value={value} req={0}></Star>
      {/* {star(value, 1)}
      {star(value, 2)}
      {star(value, 3)}
      {star(value, 4)} */}

      <span> {text && text} </span>
    </div>
  );
};

export default Rating;
